import React from "react";

export const Article = ({item}) => {
  return (
    <div>
      <div class="jumbotron">
        <h5 class="display-5">{item.title}</h5>


        <p class="lead">
          <a href={item.url} >
            Learn more
          </a>
        </p>
      </div>
    </div>
  );
};
